import React from "react";

function PersonalAd({ personalAd }) {
  return (
    <div>
      <h2>{personalAd.name}</h2>
      <p>{personalAd.description}</p>
      <img src={personalAd.image} alt="product/service" />
      <h3>${personalAd.price}</h3>
    </div>
  );
}

export default PersonalAd;
